import React, { Component } from "react";
import Navbar from "./components/layout/Navbar";
import "./App.css";

class App extends Component {
  render() {
    const name = "John Doe";
    return (
      <div className="App">
        <h1> Hello {name} </h1>
      </div>
    );
  }
}

export default App;
